import React from 'react'
import { Container, Row } from "react-bootstrap"
import '../receipt.css';
import Receipt from "../components/receipt";

export default () => {

  return (
    <div className="component tenth-component">
      <Container className="center-block" style={{ alignSelf: 'center', }}>
        <Row>
          <h2>ค่าใช้จ่ายขั้นต่ำใน 1 เดือน</h2>
        </Row>
        <Row>
          <Receipt />
        </Row>
        <Row>
          <h3>ซึ่งราคาเหล่านี้ยังไม่รวมค่าแอลกอฮอลล้างมือ/ หน้ากากอนามัย/ ค่าไฟจากการฟังแถลงที่ไม่รู้เรื่อง/ ค่าประกันโควิด ...</h3>
        </Row>
      </Container>
    </div>
  );
};
